INSERT INTO `appreciationGenerale` VALUES ('Volontaire et assidu, Enzo s\'adapte bien aux nouveaux apprentissages et se fait fort de l\'accompagnement de ses équipiers.\r\nIl doit encore pratiquer assidûment pour appréhender plus facilement certains aspects techniques en cours d\'acquisition.',1,1),('Florian assimile bien les bases mais a tendance à se compliquer énormément la tâche. \r\nIl cherche des solutions qui sont dans sa logique mais qui ne représentent pas forcément une solution viable.\r\nIl a tendance à revenir trop souvent sur un traitement fonctionnel et, à force de le remanier, sans que cela soit nécessaire, a tendance à le rendre plus lourd que ce qu\'il était ou devrait être.\r\nIl n\'hésite pas cependant à demander de l\'aide et cela lui réussit.\r\nLa pratique et l\'expérience lui ouvriront d\'autres visions plus \"logiques\".',2,1),('Bon travail de remise à niveau en développement.\r\nD\'origine spécialisé dans le réseau, Eric fait preuve d\'une certaine logique qui lui a causé quelques soucis à l\'acquisition des bases du développement, surtout en objet.\r\nCette étape maintenant passée, Eric progresse bien et montre de grandes capacités d\'autonomie.\r\nAttention cependant à ne pas rester bloqué sur une solution, peut-être que d\'autres présentent d\'autres avantages même si ce n\'est pas la première à laquelle Eric a pensé.',3,1),('Guillaume fait preuve d\'une grande capacité d\'auto-apprentissage grâce à sa persévérance et son obstination.\r\nGuillaume doit cependant chercher à ne pas essayer de trouver la solution la plus complexe qui soit, il doit chercher à se simplifier le travail. ',4,1),('Bon travail, Anthony est volontaire et autonome et n\'hésite pas à faire partager ses acquis avec ceux qui peuvent avoir plus de difficultés. \r\nBelle application des acquis. ',5,1),('Malgré certaines difficultés à la compréhension de la logique du métier de développeur, Maxence a su prendre à bras le corps ses lacunes et parvient à acquérir les notions nécessaires à la réalisation des exercices demandés et à l\'apprentissage des technologies abordées.\r\nMaxence doit pratiquer pour améliorer ses acquis.',6,1),('Autonome et efficace, Séverine acquiert très bien les apprentissages et assimile de manière plutôt efficaces les techniques et technologies abordées.\r\nBon apprentissage et belle évolution.',7,1),('Bon travail, Loïc est efficace et volontaire. Il n\'hésite pas à aider ses camarades ni à proposer des solutions aux exercices demandés. ',8,1),('Rodolphe a très bien assimilé les notions de base et montre une belle évolution.\r\nIl doit cependant ne pas hésiter à demander de l\'aide lorsqu\'il bloque sur des points particuliers.\r\nMalgré le fait qu\'il parvienne a trouver les solutions, cela lui permettrait de se pencher sur d\'autres points qu\'il a pu laisser de côté.',9,1),('Belle progression, Nathalie a su acquérir efficacement les notions principales et les appliquer au delà des notions assimilées en cours. \r\nElle n\'hésite pas à demander de l\'aide et à remanier ses logiques en fonction des apports qu\'elle peut avoir.\r\nElle présente également une pédagogie intéressante pour retransmettre des informations qu\'elle a assimilées. \r\nBon travail, la pratique permettra de valoriser l\'investissement.',10,1),('Bon travail, les notions de bases sont acquises, Antoine doit encore pratiquer pour aller plus loin.\r\nAttention à ne pas être trop discret et ne pas hésiter à demander un coup de main pour se débloquer.',11,1),('Bon travail, belle implication dans les modules, tenace et déterminé, Mickael fait preuve d\'une belle efficacité dans son apprentissage.',12,1),('Vianelle a su faire preuve de persévérance pour assimiler les notions qu\'il lui manquaient au niveau des bases sur le développement. \r\nBon travail, belle implication générale, n\'hésite pas à demander de l\'aide pour débloquer certains points.\r\nLa pratique lui permettra de valider tous ces acquis et la rendra plus performante.',13,1),('Bon travail, bonne acquisition, David reste cependant trop discret. Il est difficile de dire si tout est acquis ou en cours d\'acquisition. David fait son petit bonhomme de chemin, réalise les travaux demandés, mais ne manifeste pas ou peu ses difficultés.',14,1),('Bonne progression, Axel assimile des notions qui lui étaient totalement étrangères et parvient à surmonter plutôt efficacement les difficultés qu\'il rencontre. Il n\'hésite pas à demander de l\'aide ou à se faire réexpliquer les notions qu\'il a pu ne pas saisir. \r\nIl faut persévérer en pratiquant pour devenir plus rapide et performant.',15,1),('Bon travail, quelques difficultés au début rencontrées sur la programmation mais que Charlie a su surmonter.\r\nBelle progression, un peu discret mais bien intégré.',16,1),('Bon travail, Benoît est volontaire et persévérant. Il n\'hésite pas à demander de l\'aide mais aussi à aider et fait preuve d\'une prise de hauteur plus efficace quand à l\'analyse des besoins et des spécifications. Ses réflexions sont pertinentes et il n\'hésite pas à les remettre en question si besoin.',17,1),('Les débuts ont été un peu difficiles pour Pauline mais elle a su rester forte devant les difficultés rencontrées et n\'a pas hésité à en parler pour que les intervenants et ses camarades puissent l\'accompagner plus efficacement.\r\nMaintenant, elle est beaucoup plus a l\'aise et a su se prouver qu\'elle en était tout à fait capable.\r\nElle a besoin de beaucoup de pratique pour assimiler parfaitement les notions mais elle est très volontaire et fait preuve d\'une grande force de caractère pour mener à bien ses missions. Bon travail, il faut continuer sur cette lancée.',18,1),('Elmin présente encore quelques lacunes sur des notions de bases mais se fait fort d\'y remédier en travaillant et en n’hésitant pas à aller chercher les informations qui lui permettront d\'avancer.\r\nElmin est très motivé et son évolution en est la preuve.',19,1),('Matthieu est assidu et volontaire, il assimile les notions au fur et à a mesure et les applique avec une certaine efficacité.\r\nMatthieu doit apprendre à organiser son code et a éviter le mode \"brouillon\" (des blocs de codes en commentaires un peu partout dans son source) ce qui lui permettra de comprendre et de répondre plus efficacement encore aux exercices demandés.\r\nLa pratique lui permettra également de faire correspondre plus facilement ses idées à ses réalisations. ',20,1),('Belle capacité d\'apprentissage, Bruce est autonome mais reste encore trop discret. Il apprend vite, bien, mais doit encore pratiquer pour parfaire son apprentissage et produire des réalisations plus performantes.',21,1),('Bonne progression, quelques difficultés surmontées soit de façon autonome, soit en s\'aidant des ressources autour de lui, Arthur est ouvert et volontaire.\r\nAvec plus de pratique, il n\'en sera que meilleur.',22,1),('Bénédicte assimile bien et retient les informations correctement. Elle doit cependant réussir à appliquer une certaine logique qu\'elle est en cours d\'acquisition pour que ses réalisations soient plus performantes et exploitables. \r\nBénédicte présente une belle courbe d\'apprentissage et sa persévérance lui permettra d\'aller encore plus loin.',23,1),('Très dynamique tant dans ses pensées que dans ses réalisations, Camille est très autonome tout en sachant s\'aider des ressources dont elle dispose.\r\nElle apprend vite, comprend vite et parvient à reproduire et produire des choses de qualités de manière assez intuitive et rapide.\r\nBon travail.',24,1),('Alexis assimile bien les notions et les applique sans trop de difficultés.\r\nBon apprentissage même si je pense qu\'un peu moins de discrétion lui serait bénéfique.',25,1),('Kévin a su produire des choses surprenantes. Il apprend bien, vite et malgré une grande discrétion (qui pourrait faire croire qu\'il a du mal a s\'intégrer), Kévin est capable de produire et de reproduire de belles réalisations. Attention toutefois à l\'organisation, tant au niveau du code que de ce qui l\'entoure. Bon travail.',26,1),('Avec des bases déjà bien assimilées, Yann est productif, efficace, meneur et force de proposition sur un certain nombre de technologies qu\'il a acquis. \r\nYann est également très à l\'aise dans l\'accompagnement, il aide beaucoup ses camarades et cela semble lui plaire.\r\nUne très belle intégration dans le groupe. ',27,1),('Autonome, efficace, persévérant, Alexandre fait preuve d\'une belle capacité d\'apprentissage et réalise des choses qui vont au delà des notions acquises sur les bases du métier de développeur. \r\nBon travail, également à l\'aise dans l’accompagnement de ses camarades, il ne demande pas beaucoup d\'aide mais sait trouver les réponses à ses questions quand il en a besoin.',28,1),('Bon apprentissage, Lucas est persévérant et motivé. Cela lui permet d\'acquérir les notions malgré certaines difficultés qui s\'estompent au fur et à mesure des apprentissages. Lucas doit pratiquer pour parfaire ses acquis et continuer sa progression. Bon travail.',29,1),('Bon travail, bon apprentissage, un peu trop discret mais Valentin sait trouver les réponses dont il a besoin. La pratique lui permettra de continuer sa progression et lui donnera la possibilité d\'assimiler plus efficacement certaines notions qu\'il ne maîtrise pas encore. ',30,1),(NULL,31,2),(NULL,32,2),(NULL,33,2),(NULL,34,2),(NULL,35,2),(NULL,36,2),(NULL,37,2),(NULL,38,2),(NULL,39,2),(NULL,40,4),(NULL,47,8),(NULL,48,8),(NULL,49,8),(NULL,50,8),(NULL,51,8),(NULL,52,8),(NULL,53,8),(NULL,54,8),(NULL,55,8),(NULL,56,8),(NULL,57,8),(NULL,58,8),(NULL,59,8),(NULL,60,8),(NULL,61,8),(NULL,62,8),(NULL,63,8),(NULL,64,8),(NULL,65,8),(NULL,66,8),(NULL,67,8),(NULL,68,8),(NULL,69,8),(NULL,70,8),(NULL,71,8),(NULL,72,8),('Bon travail et acquisition des notions fondamentales, Joffrey fait preuve d\'une approche technique bien assise mais doit faire attention à l\'implémentation des notions qui lui sont demandées. Joffrey reste encore un peu brouillon dans ses idées et la retranscription des traitements s\'en ressent.\r\nDe la pratique lui permettra de palier à cela et lui donnera les éléments nécessaires pour être pleinement à l\'aise sur le sujet.\r\nUn peu plus de participation serait profitable également.',72,37),(NULL,73,8),(NULL,74,8),(NULL,75,8),(NULL,76,8),(NULL,77,8),(NULL,78,8),(NULL,79,8),(NULL,80,8),(NULL,81,8),(NULL,82,8),(NULL,83,7),(NULL,83,17),(NULL,84,7),(NULL,85,7),(NULL,86,7),(NULL,87,7),(NULL,88,7),(NULL,89,7),(NULL,90,7),(NULL,91,7),(NULL,92,7),(NULL,93,7),(NULL,94,7),(NULL,95,7),(NULL,96,7),(NULL,97,7),(NULL,98,7),(NULL,99,7),(NULL,100,7),(NULL,101,7),(NULL,102,7),(NULL,103,7),(NULL,104,7),(NULL,105,7),(NULL,106,7),(NULL,107,7),(NULL,108,7),(NULL,109,7),(NULL,110,7),(NULL,111,7),(NULL,112,7),(NULL,113,6),(NULL,114,6),(NULL,115,6),(NULL,116,6),(NULL,117,6),(NULL,118,6),(NULL,119,6),(NULL,120,6),(NULL,121,6),(NULL,122,6),(NULL,123,6),(NULL,124,6),(NULL,125,6),(NULL,126,6),(NULL,127,6),(NULL,128,6),(NULL,129,6),(NULL,130,6),(NULL,131,6),(NULL,132,6),(NULL,133,6),(NULL,134,6),(NULL,135,6),(NULL,136,6),(NULL,137,6),(NULL,138,6),(NULL,139,6),(NULL,140,6),(NULL,141,6),(NULL,142,6),(NULL,143,6),(NULL,144,6),(NULL,145,6),(NULL,146,6),(NULL,147,6),(NULL,148,6),(NULL,149,6),(NULL,150,6),(NULL,151,6),(NULL,152,6),(NULL,153,6),(NULL,154,6),(NULL,155,6),(NULL,156,6),(NULL,157,6),(NULL,158,6),(NULL,159,6),(NULL,160,6),(NULL,161,6),(NULL,162,5),(NULL,163,5),(NULL,164,5),(NULL,165,5),(NULL,166,5),(NULL,167,5),(NULL,168,5),(NULL,169,5),(NULL,170,5),(NULL,171,5),(NULL,172,5),(NULL,173,5),(NULL,174,5),(NULL,175,5),(NULL,176,5),(NULL,177,5),(NULL,178,5),(NULL,179,5),(NULL,180,5),(NULL,181,5),(NULL,182,5),(NULL,183,5),(NULL,184,5),(NULL,185,5),(NULL,186,5),(NULL,187,5),(NULL,188,5),(NULL,189,5),(NULL,190,5),(NULL,191,5),(NULL,192,5),(NULL,193,5),(NULL,194,5),(NULL,195,5),(NULL,196,5),(NULL,197,5),(NULL,198,5),(NULL,199,5),(NULL,200,5),(NULL,201,5),(NULL,202,5),(NULL,203,5),(NULL,204,5),(NULL,205,5),(NULL,206,5),(NULL,207,5),(NULL,208,5),(NULL,209,5),(NULL,210,5),(NULL,211,5),(NULL,212,5),(NULL,213,5),(NULL,214,4),(NULL,215,4),(NULL,216,4),(NULL,217,4),(NULL,218,4),(NULL,219,4),(NULL,220,4),(NULL,221,4),(NULL,222,4),(NULL,223,4),(NULL,224,4),(NULL,225,4),(NULL,226,4),(NULL,227,4),(NULL,228,4),(NULL,229,4),(NULL,230,4),(NULL,231,4),(NULL,232,4),(NULL,233,4),(NULL,234,4),(NULL,235,4),(NULL,236,4),(NULL,237,4),(NULL,238,4),(NULL,239,4),(NULL,240,4),(NULL,241,4),(NULL,242,4),(NULL,243,4),(NULL,244,4),(NULL,245,4),(NULL,246,4),(NULL,247,4),(NULL,248,4),(NULL,249,4),(NULL,250,4),(NULL,251,4),(NULL,252,4),(NULL,253,4),(NULL,254,4),(NULL,255,4),('Marc-Robert est assidu et attentif, il enregistre les informations, parvient à retranscrire les éléments mais nécessite de pratiquer encore plus pour bien en appréhender les tenants et les aboutissants.\r\nLe module de SQL a été satisfaisant malgré une évaluation pour laquelle il a paniqué et s\'est mélangé dans les réponses.\r\nConcernant le module de développement Web, Marc-Robert a bien assimilé les connaissances de bases et parvient à s\'y retrouver assez bien, il a besoin de temps pour bien en assimiler les subtilités.',256,10),(NULL,257,10),('Saloua présente une bonne courbe d\'apprentissage malgré quelques difficultés à assimiler en profondeur des notions particulières concernant la programmation. Cependant, elle présente assez de persévérance et de volonté pour lui permettre de comprendre et d\'assimiler à son rythme les notions élémentaires. Bon travail. Encore de la pratique pour progresser.',258,10),('David est un apprenant assidu et régulier, il assimile correctement les informations qui lui sont transmises et parvient à de bons résultats dans la réalisation des exercices et des TP. Il reste assez discret et pose peu de questions mais cela ne semble pas le désavantager. Bon travail.',259,10),('Mouhamed est un apprenant curieux et volontaire. Il participe assez facilement, n\'hésite pas à poser des questions et assimile beaucoup par auto-apprentissage. Bon profil, il a besoin de pratiquer pour compléter sa formation.',260,10),('Alizée est à l\'aise dans le développement et l\'apprentissage des notions relatives à ce domaine de compétences. Elle parvient à réaliser aisément les exercices, persévérante et attentive, elle présente une très bonne coure d\'apprentissage. Elle s\'intéresse et pose des questions, elle aide également ses camarades autant qu\'elle peut. Très bon profil.',261,10),('Montasser est attentif et assidu, participatif et autonome. Il n\'hésite pas à poser des questions sur les points qu\'il ne comprend pas forcément et complète facilement les informations par les recherches qu\'il effectue aisément sur le net. Montasser peut manquer un peu de rigueur dans son code mais la pratique et l\'expérience lui permettront de résoudre ce point.',262,10),('Rémy est un apprenant efficace et très autonome mais trop discret. Il est difficile de juger de sa capacité d\'assimilation durant les phases théoriques mais la pratique ne pose pas de soucis particulier. Bon travail, bon apprentissage, Rémy doit apprendre à s\'ouvrir un peu plus pour lui permettre de progresser plus rapidement.',263,10),('Sébastien présente un profil très efficace, autonome mais peut-être un peu trop perfectionniste. Il assimile bien, comprend vite, est curieux, pose des questions, n\'hésite pas à s\'aventurer hors de sa zone de confort. Bon apprentissage, doit encore pratiquer pour gagner en aisance sur le développement.',264,10),('Antoine est persévérant et déterminé, il met de gros efforts dans la réalisation de ce qu\'il fait, il n\'hésite pas à essayer des choses qu\'il n\'a pas encore bien compris et parvient malgré tout à des résultats probants. Il est très motivé par le développement Web et met de grands espoirs dans ce domaine. Bon travail, perfectionniste et assidu, il n\'hésite pas à poser des questions et à compléter son apprentissage par des recherches ciblées.',265,10),('Max-Charles est un apprenant motivé et intéressé. Il présente certaines aptitudes d\'apprentissage et dispose d\'une belle faculté d\'adaptation et de compréhension technique. Il est participatif et intégré, accompagne facilement ses camarades. Juste une petite tendance à douter de ses capacités mais qui ne l\'empêche pas d\'évoluer. Bon travail',266,10),('Jordan est relativement discret mais cela ne l\'empêche pas de réaliser une bonne courbe d\'apprentissage. Attentif et intéressé, il a besoin de pratiquer pour assimiler pleinement les différentes subtilités des techniques apprises. Il présente un intérêt certain pour des techniques particulières et certaines notions liées à l\'infrastructure et au réseau. Il sait trouver de bonnes solutions aux exercices et n\'hésite pas à sortir un peu de sa zone de confort même si on sent bien qu\'il n\'est pas à l\'aise à 100%. Bon travail, doit continuer à pratiquer.',267,10),(NULL,268,10),(NULL,269,11),(NULL,270,11),(NULL,271,11),(NULL,272,11),(NULL,273,11),(NULL,274,11),(NULL,275,11),(NULL,276,11),(NULL,277,11),(NULL,278,11),(NULL,279,11),(NULL,280,11),(NULL,281,11),(NULL,282,11),(NULL,283,11),(NULL,284,11),(NULL,285,11),(NULL,286,11),(NULL,287,11),('En plus d\'être ouvert et curieux, David est constructif dans son apprentisage. Il acquiert les modules, malgré certaines lacunes techniques qu\'il parvient à effacer en travaillant. Bon comportement général, approche professionnelle sérieuse.',288,13),('Pierre est un étudiant assidu et impliqué, il acquiert les notions à son rythme sans faillir et obtiens des résultats intéressants sur les modules.\r\nIntérêt serieux et appliqué, approche professionnelle réelle, comportement ouvert et correct.',289,13),('Emeline est efficace et persévérente, belle courbe d\'apprentissage, bons acquis.\r\nDe part ses expériences, elle a une apporche plutôt professionnelle même si elle ne se mets pas assez en valeur et devrait apprendre à s\'affirmer plus.',290,13),('Bonne acquisition générale de la formation et des modules suivis. Benjamin est efficace et assidu, impliqué et professionnel.',291,13),('A l\'aise dans un certain nombre de modules, Jonathan a su mettre à profit ses acquis passés et les mixer avec les encours.\r\nJonathan est encore jeune et doit encore acquérir de la maturité pour profiter pleinement de ses acquisition en entreprise et en équipe.',292,13),('Kateryna est impliquée et attentive. Elle fourni beaucoup d\'efforts pour apprendre et ces efforts sont porteurs. Cependant, elle reste un peu en retrait car manque de pratique et a besoin de plus de temps pour appréhender les notions un peu complexes. \r\nElle sait demander de l\'aide et n\'hésite pas à poser des questions. Elle mettra un peu plus de temps à gagner en autonomie mais son acharnement est réel et efficace.',293,13),('Impliqué et productif, Jérémy est efficace dans son apprentissage. Manquant un peu de participation et de curiosité, il n\'hésite pas à s\'entourer des éléments qui lui permettront d\'avancer.\r\nD\'un naturel assez discret, il s\'inclut dans les conversations mais ne présente pas un profil de meneur. Approche professionnelle sérieuse.',294,13),('Bons acquis, malgré des difficultés techniques qui l\'ont mise à mal plus d\'une fois, elle a su rebondir et se faire aider pour parvenir à surmonter les épreuves.\r\nBon travail.\r\nCaractère assez fort, elle saura s\'intégrer dans une équipe et se faire entendre si besoin.\r\nApproche professionnelle intéressante, à adapter en fonction des situations.',295,13),('Jimmy n\'est pas un technicien à l\'origine mais il a su s\'intéresser et progresser dans les modules.\r\nApproche professionnelle très axée sur le dialogue, le partage et le dynamisme. Commercial dans l\'âme, il fera un très bon technico-commercial et par l\'expérience passera facilement au dessus des postes de management.',296,13),('Assez discret mais d\'un naturel curieux, Aurélien acquiert les modules avec une belle facilité.\r\nIl doit encore pratiquer pour maîtriser les notions avancées.\r\nBonne approche professionnelle.',297,13),('Très discrète, Elodie ne pose pas beaucoup de question mais celles qu\'elle entreprend de poser sont fondées et mûrement réfléchies. Constructive et productive, Elodie est efficace et acquiert les modules avec brio.\r\nApproche professionnelle encore un peu fébrile mais l\'exérience lui permettra d\'être plus à l\'aise et son intégration n\'en sera que plus facile.',298,13),(NULL,299,13),(NULL,300,13),(NULL,301,13),(NULL,302,13),('M.G. : Le module MERISE n\'a pu être évalué. Cependant, lors des travaux dans les autres modules et le projet, Fleur a su démontrer un bon niveau d\'acquisition des principes de ce module.',303,13),(NULL,304,13),('M.G. : Module MERISE non évaluable. Cependant, Benjamin a su démontrer, au cours des autres modules et du projet, une bonne acquisition des principes de ce module.\r\nBenjamin a tendance à toujours compliquer ses traitement et fait beaucoup de petites erreurs d\'étourderie. Cependant, il est persévérant et méthodique, ce qui lui permet de bien appréhender l\'intégralité de ce qu\'il écrit. \r\nBonne intégration, il est un bon accompagnant dans les projets et n\'hésite pas à prendre des initiatives pour aider les autres.',305,13),('Très assidue et persévérante, Mélissa sait combler ses quelques lacunes techniques par une implication à la hauteur de ce qu\'elle souhaite qualitativement produire.\r\nAppliquée et à l\'écoute. \r\nUne certaine curiosité malgré une forte propension à se dépatouiller par elle-même. \r\nBonne intégration',306,13),('Une très belle implication, très productive malgré une apprente sensation d\'être complètement largué. Glenn est curieux et n\'hésite pas à chercher de l\'aide ni à en demander lorsqu\'il bloque.',307,13),('Très impliquée et appliquée, Sirika sait utiliser efficacement ses apprentissages et mettre à profit tous les TP et exercices pour acquérir les modules.',308,13),('Très impliqué et curieux, Jérémie est un élément très agréable, courtois et respectueux.\r\nIl a une forte tendance à se compliquer les choses et à être très pointilleux et perfectionniste ce qui lui fait perdre du temps. Il doit apprendre à s\'organiser différemment pour être encore plus efficace.\r\nIl est un élément fort qui accompagnera et tirera ses équipe vers l\'avant mais a tendance à beaucoup douter de ses propres décisions.\r\nTrès bonne implication, très bon travail.',309,13),('Maxime cache bien son jeu. Il est assidu et attentif, à l\'écoute et prêt à aider mais reste très discret en participation.\r\nPourtant, son travail est de qualité et son implication est réelle et sérieuse.\r\nBon travail.',310,13),('Très discret, Benjamin gagnera à s\'exprimer pour évoluer et progresser. \r\nBon travail, bon apprentissage.\r\nLes bases sont acquises, à pratiquer pour être plus à l\'aise.',311,13),('Avec de bonnes bases déjà acquises, Soren a profité des apports de la formation pour se perfectionner.\r\nBon élément, toujous prêt à aider et accompagner.\r\nMériterait de se rapprocher un peu plus des autres, donne l\'impression d\'être assez solitaire même si ce n\'est pas le cas lorsque le besoin est présent.\r\nBon travail',312,13),('Bon élément, très impliqué et intéressé. Communiquant, n\'hésite pas à demander de l\'aide.\r\nBon travail, belle courbe d\'apprentissage.',313,13),('Très impliqué et sérieux, curieux et professionnel, Etienne est porteur d\'une belle mission d\'accompagnement de Katerina. Il est capable d\'adapter ses explications et se met facilement au nveau de son auditoire.\r\nTrès bonne courbe d\'apprentissage. Bon travail',314,13),('Constructive et impliquée, Stéphanie est un élément moteur et meneur.\r\nElle n\'hésite pas à prendre des décision mais n\'impose jamais ses choix et sait attendre le consentement de son équipe.\r\nElle doit apprendre à simplifier son code pour progresser encore plus.\r\nBon travail, bonne courbe d\'apprentissage avec des bases déjà bien comprises.',315,13),('Florian est très discret, il est difficile de savoir si il est en difficulté ou pas.\r\nPourtant les travaux rendus sont correctement réalisés et compris. \r\nDoit apprendre à s\'exprimer et se rapprocher des autres pour progresser plus.\r\nBon travail',316,13),(NULL,317,13),('',318,14),(NULL,319,14),(NULL,320,14),(NULL,321,14),(NULL,322,14),(NULL,323,14),(NULL,324,14),(NULL,325,14),('Bon apprentissage, Amélie est efficace et construite. Sa logique lui permet d\'appréhender assez bien les modules, même pour les points plus complexes et elle n\'hésite à partager ses acquis.\r\nElle acuiqert assez facilement les notions principales et n\'héiste pas à pratiquer pour faire évoluer ses techniques.\r\nElle mériterait de participer un peu plus et de partager ses acquis pour gagner en aisance et en qualité d\'apprentissage.\r\nBonne progression.',326,20),('Loïc est très volontaire et curieux, ce qui lui permet d\'appréhender les modules dans de bonnes conditions.\r\nLoïc dit apprendre à simplifier et organiser ses pensées et leurs applications.\r\nSa curiosité le pousse à poser beaucoup de questions pertinentes et son apprentissage s\'en ressent mais Loïc doit s\'appliquer à structurer plus efficacement son travail pour en acquérir les fondements.\r\nBon apprentissage.',327,20),('Guillaume est un apprenant efficace et attentif, il dispose de certaines facilités liées à ses expériences personnelles et gagnera à les partager plus librement.\r\nIl fait preuve d\'une belle curiosité et d\'une bonne autonomie.\r\nAttention toutefois à ne pas perdre trop de temps sur des principes qui ne sont pas vitaux.\r\nBonne acquisition générale des différents modules.',328,20),('Victor fait preuve d\'une belle autonomie et en retire une acquisition efficace des modules mais ne doit pas s\'entêter inutilement. \r\nIl doit apprendre à poser des questions et demander de l\'aide.\r\nIl reste encore des points qu\'il doit pratiquer pour les appréhender correctement mais c\'est une belle acquisition générale des modules.\r\nBon travail',329,20),('Mélissa présente une belle capacité d\'engagement et d\'apprentissage, curieuse et ouverte, elle n\'hésite pas à demander de l\'aide et à apporter la sienne.\r\nBonne progression, doit pratiquer pour qualifier ses apprentissages.',330,20),('Awa est pleine de ressources, elle acquiert les notions principales et n\'hesite pas à mettre sa curiosité en application pour comprendre et appréhender les notions plus complexes.\r\nAwa a besoin de pratiquer et de s\'exercer et à cette volonté naturelle.\r\nNe pas hésiter à poser des questions lui permettra d\'améliorer son apprentissage.',331,20),('Romain est consciencieux et appliqué et mériterait de s\'ouvrir un peu pour faire partager ses doutes et ses expériences.\r\nRomain va à l\'essentiel et acquiert progressivement et sûrement les compétences.\r\nBonne courbe d\'apprentissage.',332,20),('Plutôt discret et avenant, Kévin fait preuve d\'une belle capacité d\'apprentissage et d\'acquisition.\r\nIl sait utiliser ses acquis pour avancer dans les modules et fait preuve d\'une bonne autonomie.\r\nIl gagnerait beaucoup à ne pas hésiter à demander de l\'aide lorsqu\'il bloque sur des point techniques particuliers.\r\nKévin doit pratiquer pour mettre à profit ses apprentissages.\r\nBon travail.',333,20),('Rubina fait preuve d\'une belle persévérence qui lui permet d\'acquérir les compétences et les notions principales.\r\nCependant, elle doit apprendre à ne pas se décourager lorqu\'elle rencontre des difficultés.\r\nSa curiosité et son ouverture lui permettent de s\'accrocher et elle doit continuer dans cette voie.\r\nBonne progression.',334,20),('Bon apprentissage, Kelly a su prendre le dessus sur des points techniques qui la métaient en difficulté.\r\nElle doit persévérer pour acquérir au mieux les différentes technologies et les techniques plus abouties.\r\nBonne progression.\r\n',335,20),('Laurent est curieux et assidu, ce qui lui permet de suivre une belle courbe de progression au travers des mdules.\r\nIl doit ne pas hésiter à poser des questions, ce qui lui permettra de gagner en aisance sur l\'approche de certains points.\r\nIl est efficace et va à l\'essentiel, un peu plus de rigueur lui permettra d\'être plus à l\'aise sur ses techniques.\r\nBon apprentissage.',336,20),('Jérémy est efficace et persévérent, ce qui lui permet d\'apprendre et de comprendre les principes fondamentaux sans trop de difficulté.\r\nIl doit continuer dans sa lancée pour acquérir les derniers points mais il présente une belle courbe d\'aprentissage qui ne serait que plus importante encore en s\'ouvrant pour poser des questions et demander de l\'aide quand nécssaire. \r\nJérémy n\'hésite pas à venir en aide aux autres.\r\nBon apprentissage.',337,20),(NULL,340,23),('Victor est persévérent et efficace. Sans aucune notion de départ, il assimile bien et reproduit assez efficacement.\r\nIl doit pratiquer pour être plus à l\'aise et autonome. Il est en bonne voie pour évoluer rapidement et aller vite.\r\nIl a besoin d\'apprendre à simplifier sa perception pour être encore plus efficace.\r\nBon travail. Bonne courbe d\'apprentissage.',341,24),('Apprenant travailleur et assidu, persévérent. Doit pratiquer pour être plus autonome et confiant.\r\nOlivier a tendance à revenir assez souvent sur des notions déjà vues même si il les a déjà comprises, démontre un esprit perfectionniste.\r\nBonne implication, travail sérieux.',342,24),('Emilient possède déjà certaines bases. Ce module lui a permis de confirmer son acquis.\r\nCurieux et souvent a l\'écoute des autres pour les aider.\r\nBon esprit d\'initiatives, belle implication.',343,24),('Fernanda est persévérente et aime approfondir son apprentissage.\r\nElle a déjà des bases sur lesquelles elle avait quelques difficultés. Ce module lui a permis de comprendre et d\'appréhender les choses sous un autre angle.\r\nAutonome et curieuse, elle s\'applique à tout comprendre au maximum et n\'hésite pas à appeler à l\'aide si besoin.\r\nBon apprentissage, sérieux et productif.',344,24),('Didier est appliqué et impliqué, c\'est nécessaire pour lui permettre d\'acquérir les informations et les modules.\r\nIl prend un peu plus de temps que d\'autres pour comprendre mais par sa persévérence, parvient à suivre et à évoluer dans le bon sens.\r\nA besoin de pratiquer sur des cas concrets pour gagner en autonomie.\r\nBon travail',345,24),('Rémy est efficace, il a déjà des bases intéressantes, il sait les appliquer mais a besoin de pratiquer pour apprendre a simplifier ses traitements.\r\nRémy est un atout pour aider et expliquer à ses camarades, il est acteur sur l\'accompagnement des autres apprenants sur les points qu\'il maîtrise. \r\nBon esprit d\'initiatives, bon travail.',346,24),('Claire est efficace mais très discrète.\r\nIl est difficile de jauger son apprentissage car elle pose peu de questions mais elle acquiert les informations et la pratique lui permet d\'appliquer correctement les modules.\r\nElle est très autonome, peut-être trop pour s\'intégrer avec aisance dans une équipe.\r\nElle n\'est pas fermée, au contraire, participe assez facilement aux échanges mais n\'est pas meneuse dans ces échanges.\r\nBonne courbe d\'apprentissage, bonne implication',347,24),('Vincent est ouvert à tous, il participe quand il y en a besoin, il accompagne les autres si il le peut et n\'hésite pas à poser des questions si besoin.\r\nSon apprentissage est efficace, il s\'intègre facilement au sein d\'une équipe.\r\nBon travail, courbe d\'apprentissage positive.',348,24),('Elsa est une force tranquille. Elle assimile, elle reproduit, elle exécute sans sourciller et n\'hésite pas à sortir de sa zone de confort.\r\nC\'est une bonne alliée dans les modules en équipe qui n\'hésite pas à demander de l\'aide si elle ne peut vraiment pas trouver de solution.\r\nElle est très persévérente et étudie les différentes possibilités d\'arriver à ses fins.\r\nBon travail. Bonne implication.',349,24),('Georgina est efficace et assimile très bien les éléments des modules. Elle demande de l\'aide si besoin et reste assez autonome pour que son apprentissage lui soit profitable.\r\nSa bonne humeur et sa vivacité en fon un atout dans une équipe, et qui plus est son implication lui permet d\'être productive assez rapidement.\r\nBonne implication, bon travail.',350,24),(NULL,351,25),(NULL,351,33),(NULL,352,25),(NULL,352,33),(NULL,353,25),(NULL,353,33),(NULL,354,25),(NULL,354,33),(NULL,355,25),(NULL,355,33),(NULL,356,25),(NULL,356,33),(NULL,357,25),(NULL,357,33),(NULL,358,25),(NULL,358,33),(NULL,359,25),(NULL,359,33),(NULL,360,25),(NULL,360,33),(NULL,361,25),(NULL,361,33),(NULL,362,25),(NULL,362,33),(NULL,363,25),(NULL,363,33),(NULL,365,25),(NULL,365,33),(NULL,366,25),(NULL,366,33),(NULL,367,25),(NULL,367,33),(NULL,368,25),(NULL,368,33),(NULL,369,25),(NULL,369,33),(NULL,370,25),(NULL,370,33),(NULL,371,25),(NULL,371,33),(NULL,372,25),(NULL,372,33),(NULL,373,25),(NULL,373,33),(NULL,374,25),(NULL,374,33),(NULL,375,25),(NULL,375,33),('Victorien a bien compris les principes, a su les retranscrire assez aisément mais a besoin de pratiquer plus pour orienter ses réflexions. Il se pose beaucoup de question car il possède un bagage technique plus léger que les autres stagiaires. Du coup, il prend plus de temps pour assimiler mais reste efficace et productif.\r\nBon apprentissage, stagiaire agréable et intéressé, doit pratiquer pour approfondir.',376,29),('Lena a des souvenirs du SQL que la formation a su faire revenir. Elle reste très ancrée aux habitudes de SAS mais parvient à assimiler les notions du SQL assez facilement. Elle n\'utilisera pas le PL/SQL ni le DDL mais elle a su en acquérir les fondements. Elle a besoin de pratiquer pour faciliter son analyse et sa conception logique de programmes.\r\nBonne courbe d\'apprentissage, stagiaire participative et intéressée.',377,29),('A l\'instard de Lena, Paule est très habituée à SAS et use et abuse de ces habitudes. Cependant, elle a su profiter de cette formation pour comprendre plus en profondeur ce qu\'elle réalise et se rendre compte que le SQL permet beucoup de choses sans forcément devoir décomposer les traitements. \r\nElle a acquis les bases et compris les notions fondamentales, elle doit encore pratiquer pour être plus à l\'aise, surtout sur les sous-requêtes et les jointures.\r\nBon apprentissage, stagiaire très agréable et participative qui n\'hésite pas à faire savoir quand elle ne comprend pas. Bel esprit d\'initiatives.',378,29),('Jérôme a su acquérir les notions fondamentales et a fait preuve d\'une grande autonomie dans la réalisation des exercices. Il a compris les notions de bases et doit encore pratiquer pour gagner en aisance et en rapidité de conception des programmes.\r\nBonne courbe d\'apprentissage, plus discret pendant les cours que les autres stagiaires mais efficace et productif. ',379,29),('Jérémy a des bases techniques plus abouties que les autres stagiaires de la formation. Il a été plus à l\'aise sur les notions de bases et sur la partie conception et programmation. Il a su produire des résultats intéressants et utiliser ce qu\'il apprenait durant la formation à bon escient. Attention toutefois à ne pas trop compliquer les traitements, Jérémy a tendance a se lancer directement dans le code et mériterait, par ses acquis, de prendre le temps de réfléchir à la solution avant. Il y gagnerait en qualité et en efficacité. \r\nBonne courbe d\'apprentissage, stagiaire intéressé, participatif et qui n\'hésite pas à venir en aide aux autres. Bel esprit.',380,29),('Bonne courbe de progression, Maryline était plus a l\'aise car elle possédait certaines notions techniques de programmation qui lui ont permis d\'appréhender la formation et de réaliser les exercices plus facilement.\r\nIntéressée et curieuse, elle apporte une vision pertinente sur l\'analyse des problèmes proposés.',381,30),('Bon apprentissage, courbe de progression réelle et intéressante.\r\nDominique a su profiter de la formation pour comprendre les notions qu\'elle appliquait sans avoir vraiment de certitudes sur ce qu\'elle faisait.\r\nLes points sur le SQL lui ont permis d\'approfondir ses connaissances et sa maîtrise.\r\nLes rudiments de la programmation viendront par la pratique avec l\'application des notions qu\'elle a acquis durant cette formation.\r\nIntéressée et curieuse, Dominique pose des questions pertinentes, très orientées avec un but précis.',382,30),('Belle courbe d\'apprentissage, Josiane commençait la formation avec un bagage technique bien en dessous de ses collègues mais elle a su profiter des apports de la formation pour se mettre à niveau et réaliser les exercices.\r\nElle a besoin d\'un peu plus de temps pour appréhender les solutions qu\'elle doit mettre en place mais elle y parvient à force de persévérence et de curiosité.\r\nLa programmation est encore un peu floue pour elle, elle n\'a pas encore bien acquis les besoins mais à compris les principes.\r\nElle doit pratiquer pour appliquer ce qu\'elle a appris. ',383,30),('Profil très intéressé et curieux, Guillaume aime comprendre et entre en profondeur dans les concepts qu\'ils appréhende.\r\nBonne courbe d\'apprentissage, les principes sont acquis, ne lui reste qu\'à les pratiquer pour les mettre en oeuvre.',384,31),('Karelle est plutôt à l\'aise dans l\'ensemble de part ses fonctions actuelles et son apprentissage précédent en développement.\r\nElle a besoin de pratiquer pour être pleinement à l\'aise sur les notions avancées de la programmation objet. \r\nElle est efficace et obtient rapidement de bons résultats. \r\nBonne courbe de progression.',385,31),('Avelino dispose de ressources technique qu\'il sait exploiter efficacement et parvient à acquérir les points assez rapidement.\r\nEfficace et productif, il doit encore pratiquer pour être à l\'aise avec la conception d\'applications et apprendre à simplifier ses traitements.\r\nBon apprentissage, courbe de progression positive.',386,31),('Avec très peu de notions en développement d\'une manière générale, Caroline a su appliquer son expérience de conceptrice aux bases de Java mais manque de pratique et d\'expérience pour être autonome en développement d\'applications. \r\nLa programmation objet est encore pour elle assez difficile à appréhender mais elle est persévérente et a présenté un bonne courbe d\'acquisition dans ce module. \r\nReste à pratiquer et approfondir les principes.',387,31),('Alexandre est assez discret mais n\'hésite pas à poser des questions bien ciblées. \r\nAvec un passif de développeur, il acquiert assez facilement les rudiments et doit pratiquer pour appliquer son apprentissage. \r\nBon profil, bonne courbe d\'apprentissage, fait preuve d\'une certaine rigueur dans son code.',388,31),('Hervé est très orienté conception et ne pratique pas assez le développement pour être complètement opérationnel en Java.\r\nIl acquiert les principes et a encore besoin de pratique et d\'accompagnement pour les appliquer et être à l\'aise. \r\nBonne courbe de progression, il n\'avait pas de notions en Java et peu de notions en programmation objet par contre, son expérience en conception lui a permis de progresser et d\'appréhender assez efficacement les bases en Java.',389,31),('Bonne courbe d\'apprentissage, encore du travail à faire sur la manipulation des modèles et l\'exploitation des bases de données. Implication correcte, doit pratiquer pour être à l\'aise.',391,34),('Participation et implication un peu légère pour être à l\'aise sur l\'acquisition des principes avancés. Apprentissage correct qui mérite d\'approfondir.',392,34),('Acquisition général correcte mais manque de travail personnel pour assurer un apprentissage de qualité. Doit participer et ne pas hésiter à demander de l\'aide si besoin.',393,34),('Bonne implication, travaux rendus correctement réalisés, doit encore pratiquer pour être à l\'aise sur toutes les notions du module. Courbe d\'apprentissage positive. Bonne participation.',394,34),('Bon travail, participation pertinente, doit pratiquer pour être à l\'aise sur les points plus techniques tels que l\'exploitation des bases de données. Bonne courbe d\'apprentissage.',395,34),('Travail correct, malgré un manque de participation. Mériterait de s\'impliquer un peu plus sur son travail personnel. Il faut apprendre à simplifier pour gagner en efficacité. Doit pratiquer pour gagner en analyse et en compréhension des méthodes.',396,34),('Très bon travail, belle acquisition des compétences et des méthodes avancées. Très participatif, cohérent et constructif. A poursuivre.',397,34),('Bonne courbe d\'apprentissage, très participatif et constructif, bonne implication. Manque peut-être de rigueur sur les méthodes de conception et d\'analyse mais cela sera réglé avec de la pratique concrète. ',398,34),('Bonne implication, participation intéressante, pratique constructive. Courbe de progression positive, à persévérer pour gagner en \"productivité\".',399,34),(NULL,400,34),(NULL,401,34),(NULL,402,34),(NULL,403,34),(NULL,404,34),(NULL,405,34),(NULL,406,34),(NULL,407,34),(NULL,408,34),(NULL,409,34),(NULL,410,34),(NULL,411,34),(NULL,412,34),(NULL,413,34),(NULL,414,34),(NULL,415,34),(NULL,416,34),(NULL,417,34),(NULL,418,34),(NULL,419,34),(NULL,420,34),(NULL,421,34),(NULL,422,34),(NULL,423,34),(NULL,424,34),(NULL,425,34),(NULL,426,34),(NULL,427,34),(NULL,428,34),(NULL,429,34),(NULL,430,34),(NULL,431,34),(NULL,432,34),(NULL,433,34),(NULL,434,34),(NULL,435,34),(NULL,436,34),(NULL,437,34),(NULL,438,34),(NULL,439,34),(NULL,440,34),('Avec des notions en développement assez lointaines, Céline a su mettre en application ses expériences précédentes pour intégrer au maximum les bases du langage. Elle manque de pratique réelle pour être autonome mais démontre une belle implication et une forte persévérence qui lui permettront de mettre à profit ses acquis. La programmation objet et la manipulation de collections restent encore sa bête noire mais les notions et les principes démontrés lors de la formation lui permettront d\'appliquer et d\'acquérir ces éléments dans les projets. Céline a démontré un bonne courbe d\'acquisition dans ce module. Reste à pratiquer et approfondir.',441,36),('Christophe ne possédait pas d\'expérience en développement et a su montrer une grande capacité d\'assimilation et de compréhension sur ce module. Très attaché à l\'écoute, le fait de pratiquer en parallèle lui a permis de démistifier certains point et les notions de la programmation objet ont pu être abordées sans trop de difficulté. Il reste à Christophe à pratiquer un maximum pour pouvoir acquérir pleinement les notions abordées et devenir autonome et efficace. Christophe a fait preuve d\'une belle courbe de progression, à approfondir par la pratique.',442,36),('Session très constructive, Christophe a fait preuve de beaucoup d\'intérêt pour le contenu de cette formation et surtout sur le déboguage d\'une application Javascript.\r\nLes points importants de la programmation en Javascript ont été acquis, certains restent encore à pratiquer.\r\nLa progression a été continue et réelle, l\'assimilation est bonne et les rendus sont de qualité.\r\nBon travail',442,42),('Bonne participation, intéressé et concret.\r\nElie a tendance à compliquer ses traitements mais il reste cohérent.\r\nBonne acquisition des notions, implémentation satisfaisante.',444,37),('Bonne acquisition des notions du module, à l\'aise avec les notions avancées.\r\nL\'approfondissement viendra avec la pratique.\r\nAssez discret, même si le principes sont acquis, Jean-Christophe gagnerait à être plus participatif.',445,37),('Bonne participation, des notions déjà bien connues, reste à pratiquer plus pour appréhender au maximum les possibilités du scripting.\r\nDes réflexions cohérentes sur les sujets, Clelia est intéressé et constructif.',446,37),('Participation active et constructive, Arthur a su apporter des réponses variées et fonctionnelles.\r\nIl doit encore pratiquer pour approfondir ses notions déjà acquises surtout concernant la modularité des scripts et l\'implémentation de fonctions.\r\nBon travail.',447,37),('Très bonne participation, actif et intéressé, avec une certaine anticipation sur les éléments demandés.\r\nLes réponses données par Arthur sont fonctionnelles et cohérentes. Elle mériterait peut-être une petite touche d\'optimisation mais les acquis sont bien ancrés et très bien retranscrits.',449,37),('Bonne acquisition des notions élémentaires, Julien a besoin de pratiquer les principes de la programmation avancée pour être plus à l\'aise avec l\'implémentation de scripts et de modules de scripts.\r\nAssez discret, le travail de Julien mériterait plus de participation pour obtenir certains détails utiles à l\'implémentation des traitements qui lui sont demandés.',450,37),('Bonne implémentation des notions apportées, Cédric semble avoir acquis correctement les éléments fondamentaux et doit encore travailler les notions avancées pour être à l\'aise, notamment concernant l\'écriture de scripts et la modularité des traitements.\r\nAssez discret, une participation un peu plus présente serait un plus pour son acquisition.\r\nBon travail',451,37),('Actif et intéressé, Maxim fait preuve d\'une bonne acquisition des notions apportées.\r\nBon travail, malgré les difficultés rencontrées, doit encore pratiquer pour être à l\'aise avec les notions avancées.',452,37),('Participatif, communiquant et à l\'aise avec les notions, élémentaires et avancées, Benjamin est un élément moteur dans un groupe de travail.\r\nAvec un bagage technique déjà bien présent, le module lui a permis de compléter certains informations et de préciser des notions qu\'il avait pu essayer sans forcément les pratiquer intégralement.\r\nTrès bon travail, reste plus qu\'à optimiser ses idées.',453,37),('Bon acquisition, des notions déjà maîtrisées, Axel fait preuve d\'une bonne pratique des notions élémentaires et pourra compléter ses acquis par une pratique plus poussée, surtout en terme d\'écriture de scripts, fonctions et modules.\r\nParticipation intéressante, bon travail.',454,37),('Bonne acquisition des notions élémentaires et des principales notions avancées, doit encore pratiquer l\'écriture de script et l\'implémentation de fonctions et modules.\r\nAvec plus de participation, Hugo pourrait tirer encore plus d\'acquis sur ce module.\r\nBon travail',455,37),('Lilian est trop discret et les réponses apportées demontrent qu\'il a encore besoin de pratiquer les notions élémentaires pour être pleinement à l\'aise sur la réalisation des traitements demandés.\r\nDommage que le second TP n\'ai pas été réalisé car cela lui aurait permis de comprendre certaines notions qui pourraient lui faire défaut.\r\nDoit pratiquer pour acquérir les notions avancées.',457,37),('Bonne participation, intéressé et impliqué, Antoine doit être attentif à ses traitements pour être certain de leur bon déroulement.\r\nLa pratique lui permettra de consolider ses acquis et le rendra plus à l\'aise sur leur implémentation.\r\nBon travail ',458,37),('Bonne participation, des interventions pertinentes et cohérentes, apportant des notions déjà bien acquises, Boris a su profiter des élément apportés par ce module pour compléter ses acquis sur les notions élémentaires.\r\nBon travail, nonne implication, à persévérer. ',459,37),('Possédant d\'jà de bons acquis, Peïo a su profiter des notions complémentaires apportées par ce module pour optimiser et améliorer sa conception de scripts.\r\nTrès bon travail, bonne participation, un autre élément moteur dans un groupe de travail.',460,37),('Bon travail, les notions semblent acquises mais Julien reste trop discret et cela lui fait défaut car une participation un peu plus active lui permettrait d\'obtenir des précisions sur des notions complémentaires qui méritent un peu plus d\'attention.\r\nDoit pratiquer pour approfondir les acquis, dommage que le second TP n\'ait pas été réalisé.',461,37),('Adrien fait preuve d\'un intéressement certain aux notions abordées mais manque de pratique pour les maîtriser pleinement.\r\nLes travaus rendus sont corrects et fonctionnels, peut-être encore un peu d\'approfondissement sur les notions abordées pour optimiser et implémenter au mieux les principes avancés.\r\nBon travail',462,37),('Curieux et participatif, Romain est un élément moteur également dans un grouep de travail.\r\nSes acquis lui permettent d\'être pleinement autonome et il n\'hésite pas à demander de l\'aide ou des détails pour appréhender au mieux les notions qui lui font défaut.\r\nBonne participation, bon travail, continuer.',463,37),('Bon travail, les acquis sont corrects et les rendus opérationnels et fonctionnels.\r\nLouis-Armand mériterait d\'être un peu plus participatif pour lui permettre d\'obtenir des compléments sur ses notions acquises et être plus à même d\'optimiser et de modulariser ses traitements efficacement.',464,37),('Assez discret, Gilles est très à l\'écoute des informations et assimile très bien le contenu.\r\nCurieux, il n\'hésite pas à s\'aventurer sur des points plus complexes et sait demander de l\'aide si besoin.\r\nBonne acquisition des notions abordées qui sont venues compléter celles qu\'il avait déjà. Bon travail.',465,38),('Malgré un profil non développeur, Franck a su comprendre et assimiler les notions de ce module et les retranscrire.\r\nBonne participation, la progression est réelle et l\'acquisition des techniques lui permettra de réaliser ses missions.\r\nIl faudra qu\'il pratique pour ne pas perdre les automatismes. Sa persévérence lui a permis de venir à bout de ses difficultés.\r\nBon travail.',466,38),('Guylaine était très sceptique à la fois sur ses capacités et son profil mais cette formation lui a permis de découvrir et d\'apprendre beaucoup de notions qu\'elle a su retenir et reproduire, à son rythme mais efficacement.\r\nTrès persévérente et n\'hésitant pas à demander de l\'aide, elle saura intégrer ces notions dans ses réalisations.\r\nLa pratique lui permettra de compléter son apprentissage et la rendra plus à l\'aise dans l\'écriture des codes nécessaires.\r\nLa courbe de progression est très postive et encourageante. Bon travail.',467,38),('Avec de bonnes bases de développement déjà acquises, Jean-Christophe a su profiter de toutes les notions du module pour comprendre et reproduire les points abordés.\r\nL\'acquisition de ce module lui permettra de compléter efficacement ses compétences et de réaliser des développements efficaces et productifs.\r\nBonne participation, bonne progression.',468,38),('Sébastien a su mettre à profit ses notions de développeur et mettre en application efficacement tous les points de ce module. \r\nLes bases sont bien acquises, la pratique viendra compléter les notions de librairies et de framework dans lesquels il trouvera de quoi améliorer encore sa technique et continuer son évolution.\r\nBonne participation, bon travail, progression réelle.',469,38),('Nicolas avait déjà des bases en développement, ce qui lui a permis de se concentrer sur l\'essentiel et d\'acquérir efficacement les notions abordées. \r\nLa pratique lui permettra de compléter et d\'appréhender plus facilement les quelques subtilités des langages.\r\nBonne participation, progression efficace et réelle.',470,38),('Jean-Noël avait déjà quelques bases sur le développement web. Ce module lui a permis de remettre ses notions en pratique et en ordre et de bien assimiler les différentes interactions entre les technologies et les langages. Posé et consciencieux, ses interventions sont construites et constructives.\r\nLa pratique lui permettra de parfaire son acquisition et de mettre en application les notions avancées abordées dans ce module.\r\nBonne progression, bon travail.',471,38),('Jean-Luc a su apprendre et comprendre les notions abordées dans ce module et reproduire efficacement les exercices, en y ajoutant une touche de découverte non négligeable. Progression efficace, Jean-Luc devra pratiquer pour compléter les notions acquises et assurer des développements efficaces et productifs. \r\nBon apprentissage, bon travail.',472,38),('Eric est très motivé et persévérent.\r\nIl a vraiment montré une réelle montée en compétences en appliquant les principes acquis au cours de la formation sur un projet personnel.\r\nLes points très techniques (MVC principalement) nécessitent d\'être encore pratiqués mais la compréhension de la logique et sa mise en application est bonne.\r\nEric doit maintenant pratiquer pour que tout rentre dans ses habitudes et qu\'il puisse évoluer encore plus dans la direction qu\'il prend.\r\nIl sait profiter de son esprit curieux et persévérant, il a démontré une réelle implication et a su rester à l\'écoute jusqu\'au bout même lorsque ça se compliquait.',473,39),('Cédric est assidu et attentif. Il fait preuve d\'une curiosité constructive qui lui permet de bien appréhender les points techniques du programme.\r\nLa courbe de progression est réelle, Cédric a fait preuve de très bonnes capacités dans la réalisation des exercices.\r\nIl ne lui reste plus qu\'à pratiquer pour être plus à l\'aise avec les notions fondamentales et avancées.',474,40),(NULL,475,41),(NULL,476,41),(NULL,477,41),(NULL,478,41),(NULL,479,41),(NULL,480,41),(NULL,481,41),(NULL,482,41),(NULL,483,41),(NULL,484,41),('Bon apprentissage et assimilation des notions élémentaires.\r\nCécile n\'avait pas forcément de bases avancées en programmation mais son implication et sa volonté l\'ont amenée à bien comprendre les principes de base et à assimiler les points du programme, même certains qui pouvaient être plus pointus.\r\nElle aura besoin de pratiquer et de se mettre à niveau en UML pour parfaire sa compréhension de la POO.',485,43),('Bonne courbe d\'apprentissage de la part d\'Antoine qui a fait preuve d\'un raisonnement efficace dans l\'assimilation des notions du langage.\r\nLa manipulation des objets a été comprise, il reste encore à approfondir par la pratique et ces notions seront bien acquises.\r\nBon travail',486,43),('Très bonne acquisition des principales fonctionnalités du langage et de l\'environnement.\r\nLa POO reste encore à travailler pour en acquérir les fondements mais l\'apprentissage est efficace et l\'implication d\'Alexandre conforte son assimilation.\r\nBon travail',487,43),('Yann avait pour objectif principal de comprendre et d\'appréhender le language et les outils, ce que cette formation lui a permis d\'apprendre.\r\nEn terme de développement et d\'implémentation du langage, Yann a su reproduire les exercices et appliquer les notions fondamentales mais n\'a pas été à l\'aise sur les notions plus avancées. \r\nToutefois, ces points là ont été compris et sont en cours d\'acquisition.\r\nBon travail',488,43),('De bonnes bases déjà disponibles, Arnaud est à l\'aise avec les notions du programme.\r\nL\'acquisition des nouvbelles terminologies est bonne, le Javascript nécessite encore de la pratique pour être bien maîtrisé.\r\nBonne acquisition, bon travail',489,44),('Bonne implication et acquisition des éléments principaux du programme.\r\nGilles doit encore pratiquer pour être parfaitement à l\'aise.\r\nBon travail',490,44),('Bonne acquisition et implémentation des notions du programme.\r\nLa pratique permettra à Loïc d\'être encore plus efficace et productif.\r\nBon travail',491,44),('Bonne acquisition des principes généraux, Stéphane a fait preuve d\'une bonne implication et compréhension des notions.\r\nIl doit pratiquer tous ces points pour parfaire leur acquisition, déjà en bonne voie.\r\nBon travail, sa persévérence lui permettra de devenir plus efficace sur ses réalisations.',492,44),('Bruno a su implémenter et appliquer les notions abordées au fil du programme.\r\nDe la pratique lui sera nécessaire pour être parfaitement à l\'aise avec toutes les subtilités des technologies.\r\nBon travail',493,44),('Salvatore a su profiter de cette formation pour acquérir des notions essentielles au développement web.\r\nIl doit encore poursuivre son apprentissage par la pratique, surtout en Javascript mais cela ne devrait pas poser de soucis, il est appliqué et persévérant.\r\nBonne courbe de progression, bon travail.',494,44),('Très attentive et perfectionniste, application parfaite des éléments abordés pendant la session de formation.\r\nElora bénéficie d\'une très bonne expérience avec Synfony et Doctrine et a su profiter de ses acquis pour en comprendre encore mieux les subtilités durant ce \"retour aux sources\" grandement apprecié et productif.\r\nTrès bonne assimilitation de tous les points du programme, bravo.',495,45),('Assez discret, les notions abordées sont retenues, il faut encore de la pratique et du travail pour les acquérir pleinement.',496,46),('Très discret mais n\'hésite pas à poser des questions sur des points complexes',497,46),('Peu de participation mais présente une bonne capacité d\'acquisition des informations',498,46),('Bonne compréhension, doit pratiquer les notions abordées de manière plus systématiques pour les acquérir pleinement',499,46),('Curieux et appliqué, doit persévérer dans les exercices pour gagner en \"endurance\" et en \"automatisme\"',500,46),('Posséde déjà des notions d\'algo et des bases de développement, bonne acquisition mais son travail mériterait un peu plus de rigueur',501,46),('Consciencieux et pointilleux, bonne acquisition en général',502,46),(NULL,503,47),(NULL,504,47),(NULL,505,47),(NULL,506,47),(NULL,507,47),(NULL,508,47),(NULL,509,47),(NULL,510,47),(NULL,511,47),(NULL,512,47),(NULL,513,47),(NULL,514,47),(NULL,515,47),(NULL,516,47),(NULL,517,47),(NULL,518,47);
