),(NULL,206,29),(NULL,207,29),(NULL,208,29),(NULL,209,29),(NULL,210,29),(NULL,211,29),(NULL,212,29),(NULL,213,29),('Malgré une écoute attentive et des questions pertinentes, Marc Robert a besoin de temps et de pratique pour assimiler les connaissances de base en SQL.',256,26),('Marc-Robert est volontaire et intéressé par le module de développement Web. Il a encore des difficultés à intégrer toutes les notions de ce module mais ne recule pas devant les efforts nécessaires à son apprentissage. \r\nLa pratique lui apportera une bonne prise en main des outils et des éléments et lui permettra de continuer sur une bonne courbe d\'apprentissage.',256,27),('Bon apprentissage, stagiaire attentif et participatif.',257,26),('Encore quelques difficultés pour lier la théorie qu’elle comprend bien et la pratique mais une bonne courbe d’apprentissage.',258,26),('Saloua assimile correctement les informations. Certaines pratiques la mettent encore un peu en difficulté, comme l\'algorithmie, mais elle parvient à comprendre et trouver les solutions adaptées à la réalisation des exercices. Elle a besoin de pratiquer pour compléter son assimilation des particularités du Javascript.',258,27),('Bon travail, questions pertinentes et compétences justifiées.',259,26),('David a bien assimilé les notions de bases de ce module et parvient à en extraire des réalisations intéressantes. Doit continuer à pratiquer pour confirmer ses acquis. Bon apprentissage.',259,27),('Bon apprentissage, nécessite encore de la pratique pour compléter ses acquis.',260,26),('Bonne assimilation des rudiments du développement Web, Mouhamed a besoin de pratiquer pour parfaire son apprentissage. Il n\'hésite pas à tester des choses et n\'a pas peur de se casser les dents sur des exercices. Il a encore besoin de pratiquer le Javascript et le CSS mais il est en bonne voie.',260,27),('Bon travail, attentive et persévérante, bonne assimilation.',261,26),('Bonne assimilation du module, Alizée semble plutôt à l\'aise avec les rudiments du développement Web et les logiques algorithmiques. Bon travail',261,27),('Bon travail, une bonne écoute, une bonne participation.',262,26),('Bon apprentissage, malgré quelques incompréhensions, Montasser parvient à intégrer les notions du développement Web et à réaliser les exercices.\r\nBon travail.',262,27),('Très discret, un bon profil pour un bon apprentissage.',263,26),('Très discret, Rémy assimile bien, reproduit et produit des choses pertinentes. Bon apprentissage du module, il est relativement à l\'aise sur le développement Web.',263,27),('Bon travail, de bonnes interventions, apprentissage à la hauteur de ses interventions.',264,26),('Très impliqué dans l\'apprentissage de ce module, Sébastien fait preuve d\'une bonne assimilation des notions du développement Web. Il n\'hésite pas à tester, essayer, recommencer jusqu\'à parvenir à un travail qui le satisfait. Les bonnes pratiques sont assimilées, il ne lui reste plus que de l\'expérience et de la pratique pour parfaire son apprentissage.',264,27),('Bon apprentissage, beaucoup de questions qui portent leurs fruits. Doit pratiquer pour compléter ses acquis.',265,26),('Bonne compréhension du module et des rudiments du développement Web, Antoine a bien assimilé les notions et doit encore pratiquer pour parfaire son apprentissage.',265,27),('Absent 2 jours sur 3, impossible donc d\'évaluer Max-Charles sur ce module.',266,26),('Max-Charles a été inspiré par le module de Développement Web et a su en assimiler les rudiment assez facilement. Il en est même devenu \"meneur\" et aide ses camarades dans les pratiques approfondies de certains éléments liés notamment au Javascript et au CSS. Bon travail, bon apprentissage, attention tout de même à ne pas trop se compliquer le travail. L\'expérience et la pratique lui permettront d\'obtenir un peu plus de rigueur sur son développement.',266,27),('Bon apprentissage, reste assez discret, doit pratiquer.',267,26),('Jordan a bien assimilé les notions de bases du développement Web même si certains points techniques, concernant surtout le Javascript, le mettent encore en défaut. Son apprentissage est efficace, il aura besoin de pratiquer pour le compléter et gagner en aisance.',267,27),(NULL,268,26),(NULL,268,27),(NULL,276,30),(NULL,277,30),(NULL,278,30),(NULL,279,30),(NULL,280,30),(NULL,281,30),(NULL,282,30),(NULL,283,30),(NULL,284,30),(NULL,285,30),(NULL,286,30),(NULL,287,30),('',288,38),('',288,39),('',288,40),('',288,41),('',288,42),('',288,43),('',288,44),('',288,45),('',288,46),('Bonne compréhension des bases du langage mais il manque à appliquer les aspects plus avancés (exception, API)',288,47),('',288,48),('',288,49),(NULL,288,67),('',289,38),('',289,39),('',289,40),('',289,41),('',289,42),('',289,43),('',289,44),('',289,45),('',289,46),('Bon travail mais réalisé en collaboration avec Lilian Marmiesse',289,47),('',289,48),('',289,49),('',290,38),('',290,39),('',290,40),('',290,41),('',290,42),('',290,43),('',290,44),('',290,45),('',290,46),('Bonne compréhension des bases du langage mais il manque à appliquer les aspects plus avancés (exception, API)',290,47),('',290,48),('',290,49),('',291,38),('',291,39),('',291,40),('',291,41),('',291,42),('',291,43),('',291,44),('',291,45),('',291,46),('Bonne maîtrise du langage et de la programmation objet',291,47),('',291,48),('',291,49),('',292,38),('',292,39),('',292,40),('',292,41),('',292,42),('',292,43),('',292,44),('',292,45),('',292,46),('Bonne maîtrise du langage et de la programmation objet',292,47),('',292,48),('',292,49),('',293,38),('',293,39),('',293,40),('',293,41),('',293,42),('',293,43),('',293,44),('Travail trop faible (avec quelques erreurs) comparé aux autres stagiaires',293,45),('',293,46),('Bonne maîtrise du langage et de la programmation objet',293,47),('',293,48),('',293,49),('',294,38),('',294,39),('',294,40),('',294,41),('',294,42),('',294,43),('',294,44),('',294,45),('',294,46),('Bonne compréhension des bases du langage mais il manque à appliquer les as